import './App.css';

let name = "Ashish";
function App() {
  return (
  <>
   <nav>
     <li>Home</li>
     <li>Contact</li>
     <li>About</li>
     <p>Hello {name}</p>
   </nav>
  </>
  );
}

export default App;
